export const Home = () => {
    const currentDate: number = Date.now();
    const today: Date = new Date(currentDate);
    const displayDate: string = `
    ${today.getDate()} 
    ${today.getDay()} 
    ${today.getDate()} 
    ${today.getMonth()} 
    ${today.getFullYear()}
    `;

    return (
        <div> 
            <h1>Hello, Phumelele</h1>
            <h2>Today, { displayDate }</h2>
        </div>
    );
}
